import logo from './logo.svg';
import './App.css';
import  Navbar from './features/pages/navbar'
import  Footer from './features/pages/footer'
import  ourService  from './features/pages/ourservice'

function App() {
  return (
    <div className="App">
      <div className='mb-5 '>
      <Navbar/>
      </div>
      <div>
        <ourService/>
      </div>

      <div className='mt-[400]'>
        <Footer/>
      </div>


    </div>
  );
}

export default App;
